import React from "react";
import "./Honeycomb.css";

const photos = [
 "public\favicon.png",
 "public\favicon.png",
 "public\favicon.png",
 "public\favicon.png",
 "public\favicon.png",
  "public\favicon.png",
];

const Honeycomb = () => {
  return (
    <div className="honeycomb">
      {photos.map((photo, index) => (
        <div className="honeycomb-cell" key={index}>
          {/* <img src={photo} alt={`Photo ${index + 1}`} className="photo" /> */}
          <img src={photo} alt={`Scenic view ${index + 1}`} className="photo" />

        </div>
      ))}
    </div>
  );
};

export default Honeycomb;
